) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8;

/*Data for the table `equipo` */

insert  into `equipo`(`id`,`nombre`,`liga_id`,`descripcion`) values (1,'Athletic Club',1,'El Athletic Club es un club de fútbol de la villa de Bilbao, País Vasco, España. Fue fundado en 1898 y es, junto al Real Madrid Club de Fútbol y al Fútbol Club Barcelona, el único club que ha disputado todas las ediciones de la Primera División de España desde su creación en 1928. A su vez, es uno de los cuatro únicos clubes profesionales de España que no es una sociedad anónima deportiva, de manera que la propiedad del club recae en sus socios.'),(2,'Club Atlético de Madrid',1,'El Club Atlético de Madrid es una sociedad anónima deportiva con sede en la ciudad de Madrid, capital de España. El primer equipo de la entidad compite en la Liga Española de fútbol de Primera División. El Atlético de Madrid utiliza camiseta roja y blanca a franjas verticales con pantalón azul desde el año 1911. Ejerce de local en el Estadio Vicente Calderón, recinto ubicado en el distrito de Arganzuela, con una capacidad de 54.851 espectadores.'),(3,'Club Atlético Osasuna',1,'El Club Atlético Osasuna es un club de fútbol de Pamplona (Navarra, España). El equipo, en la actualidad, juega en la Primera División de España. Fue fundado el 17 de noviembre de 1920, fruto de la fusión de dos clubes de la ciudad: el Sportiva y el New Club.'),(4,'Elche Club de Fútbol',1,'El Elche Club de Fútbol es un club de fútbol español, constituido como SAD,1 con sede social en la ciudad de Elche, Comunidad Valenciana. En la actualidad compite en la Liga BBVA.'),(5,'Fútbol Club Barcelona',1,'El Fútbol Club Barcelona es una entidad polideportiva de la ciudad de Barcelona, Cataluña, España. Fue fundado como club3 de fútbol el 29 de noviembre de 1899 por doce jóvenes futbolistas aficionados, liderados por el suizo Hans Gamper.'),(6,'Getafe Club de Fútbol',1,'El Getafe Club de Fútbol es un club de fútbol de España de la ciudad de Getafe en la Comunidad de Madrid. Fue fundado el 8 de julio de 1983 (24 de febrero de 1946, Club Getafe Deportivo) y juega en la Primera División de España. Es el 58º equipo en incorporarse a Primera División siendo su primera participación la temporada 2004/05 y en la clasificación histórica de 1ª División en junio de 2013 ocupa el puesto 29º.'),(7,'Granada Club de Fútbol',1,'El Granada Club de Fútbol es una sociedad anónima deportiva de la ciudad española de Granada. Como club de fútbol fue fundado el 6 de abril de 1931 y actualmente milita en la Primera División de España.'),(8,'Levante Unión Deportiva',1,'El Levante Unión Deportiva (también llamado Llevant Unió Esportiva, en valenciano) es un club de fútbol de España. En 1909 se fundan el Real Gimnástico Club de Fútbol y el Fútbol Club Levante, coincidiendo con la fundación de la Federación Valenciana de Fútbol.'),(9,'Málaga Club de Fútbol',1,'El Málaga Club de Fútbol es un club de fútbol profesional de la ciudad española de Málaga. Milita en la Primera División de España, denominada oficialmente Liga BBVA. Su propietario es el jeque catarí6 Abdullah ben Nasser Al Thani,4 siendo el primer sheik en convertirse en máximo accionista de un club de fútbol español.'),(10,'Rayo Vallecano de Madrid',1,'El Rayo Vallecano de Madrid S. A. D. es una entidad deportiva, centrada en el ámbito futbolístico, localizada en el distrito de Puente de Vallecas, al sureste de la ciudad de Madrid (España). El club fue fundado en 1924 y actualmente su primer equipo juega en la Primera División de España. El Rayo Vallecano se sitúa en el puesto número 294 del ranking de clubes de la FIFA con 74 puntos.'),(11,'Real Betis Balompié',1,'El Real Betis Balompié es un club de fútbol de la ciudad de Sevilla, España. Actualmente milita en la Primera División de España. Sus máximos galardones son un título de Liga y dos Copas del Rey. Fue el primer equipo andaluz que jugó en Primera División, que ganó la Liga española, que ganó la Copa del Rey en su actual formato, y el primero en jugar en la Liga de Campeones de la UEFA en el actual formato.'),(12,'Real Club Celta de Vigo',1,'El Real Club Celta de Vigo S. A. D. es un club de fútbol que actualmente juega en la Primera División de España. Fue fundado en Vigo en 1923 a partir de la fusión del Vigo Sporting y el Real Fortuna. El club disputa sus partidos como local en el estadio de Balaídos, con capacidad para 31 800 espectadores e inaugurado en 1928.'),(13,'Real Club Deportivo Español',1,'El Real Club Deportivo Español, S. A. D. (oficialmente, Real Club Deportivo Espanyol de Barcelona, S. A. D.), es un club de fútbol español que juega en la Primera División. Fue fundado el 28 de octubre de 1900 por un grupo de universitarios españoles que estaban estudiando en la Universidad de Barcelona y cuyo primer presidente fue Ángel Rodríguez Ruiz. '),(14,'Real Madrid Club de Fútbol',1,'El Real Madrid Club de Fútbol, mejor conocido como Real Madrid, es una entidad polideportiva con sede en Madrid, España. Fue fundado oficialmente como un club de fútbol el 6 de marzo de 1902 por los hermanos barceloneses Juan y Carlos Padrós bajo el nombre de (Sociedad) Madrid Foot-ball Club.'),(15,'Real Sociedad de Fútbol',1,'La Real Sociedad de Fútbol, S. A. D., es un club de fútbol de España, establecido en la ciudad vasca de San Sebastián (Guipúzcoa), que juega en la Primera División.2 Tiene una larga trayectoria en la historia del balompié español, siendo uno de los únicos nueve equipos históricos que nunca han competido en división inferior a la Segunda División.'),(16,'Real Valladolid Club de Fútbol',1,'El Real Valladolid Club de Fútbol es un club de fútbol español organizado como sociedad anónima deportiva de la ciudad de Valladolid, en la comunidad autónoma de Castilla y León, y que actualmente juega en Primera División. Fue fundado el 20 de junio de 1928, fruto de la fusión de los dos clubes más importantes de la ciudad, el Club Deportivo Español y la Real Unión Deportiva.'),(17,'Sevilla Fútbol Club',1,'El Sevilla Fútbol Club es un club de fútbol español organizado como sociedad anónima deportiva. Tiene su sede en Sevilla, capital de la comunidad autónoma de Andalucía, y actualmente juega en Primera División. Sus estatutos fueron creados el 25 de enero de 1890  y aprobados el 14 de octubre de 1905, siendo su primer presidente el jerezano José Luis Gallegos Arnosa.'),(18,'Unión Deportiva Almería',1,'La Unión Deportiva Almería es un club de fútbol de España, de la ciudad de Almería. Fue fundado el 26 de julio de 1989, bajo la denominación de Almería Club de Fútbol, adoptando la actual denominación en el año 2001. En la actualidad juega en la Primera División, después de haber ascendido de la Segunda División de España tras dos temporadas seguidas en ella.'),(19,'Valencia Club de Fútbol',1,'El Valencia Club de Fútbol es una sociedad anónima deportiva con sede en la ciudad de Valencia, España. El club deportivo originario fue fundado el 18 de marzo de 1919. Su equipo de fútbol principal juega actualmente en la Primera División de España y disputa los encuentros como local en el Estadio de Mestalla, con una capacidad para 52.600 espectadores.'),(20,'Villarreal Club de Fútbol',1,'El Villarreal Club de Fútbol, S. A. D., es un club profesional de fútbol de la Primera División de España, organizado como sociedad anónima deportiva, de la ciudad española de Villarreal en la provincia de Castellón. El Villarreal C. F. nace el 25 de agosto de 1947 El origen del actual Villarreal CF lo encontramos en los inicios de los años 40. '),(21,'Arsenal',2,'El Arsenal Football Club es un club de fútbol profesional con sede en Holloway, Londres, Inglaterra. Juega en la Premier League y su antecesor desde 1919/20, siendo el equipo más longevo en primera división, y uno de los equipos con más trofeos ganados del fútbol inglés. '),(22,'Aston Villa',2,'El Aston Villa Football Club (también conocido como Villa, The Villa o The Villans) es un club de fútbol de Inglaterra Reino Unido que juega en la FA Premier League inglesa,Reino Unido. Está situado en el barrio de Aston de la ciudad de Birmingham, en el condado de West Midlands.'),(23,'Cardiff City',2,'El Cardiff City Football Club (en galés Clwb Pêl-droed Dinas Caerdydd) es un club de fútbol de Gales de la ciudad de Cardiff. Fue fundado en 1899 y competirá en la Premier League tras el ansiado ascenso a dicha división el 16 de Abril de 2013 con el empate 0-0 contra el Charlton Athletic Football Club.'),(24,'Chelsea',2,'El Chelsea Football Club, conocido simplemente como Chelsea, es un club de fútbol del oeste de la capital de Londres, Inglaterra, Reino Unido. Fue fundado el 11 de marzo de 1908 y juega en la Premier League, máxima competición futbolística de ese país.'),(25,'Crystal Palace',2,'El Crystal Palace Football Club es un club de fútbol de Inglaterra, de la parte sur de la ciudad de Londres. Fue fundado en 1905. Durante la temporada 2012-13 de la Football League Championship (Segunda División Del Fútbol Ingles), Palace terminó sexto y ganó el ascenso a la Premier League a través de los play-offs .'),(26,'Everton',2,'El Everton Football Club es un club de fútbol del Reino Unido, de la ciudad de Liverpool en el condado de Merseyside. El club compite en la Premier League, la competición más prestigiosa del fútbol británico.'),(27,'Fulham',2,'El Fulham Football Club es un club de fútbol de Inglaterra, del distrito de Hammersmith y Fulham en Londres. Fue fundado en 1879, siendo el equipo profesional más antiguo de Londres. Juega en la Premier League desde la temporada 2001/02.'),(28,'Hull City',2,'El Hull Tigers es un club de fútbol de Inglaterra, de la ciudad de Kingston upon Hull en Yorkshire. Fue fundado en 1904 y a partir de la temporada 2013/14 jugará en la Premier League,el primer escalón del fútbol inglés.'),(29,'Liverpool',2,'El Liverpool Football Club es un club de fútbol localizado en la ciudad de Liverpool, Inglaterra, Reino Unido. Juega en el estadio Anfield y utiliza una indumentaria totalmente roja. Su clásico rival más importante es el Manchester United, una rivalidad que se remonta a 1897. '),(30,'Manchester City',2,'El Manchester City Football Club es un club de fútbol inglés con sede en la ciudad de Mánchester. En la actualidad juega en la Premier League inglesa.'),(31,'Manchester United',2,'El Manchester United Football Club, mejor conocido como Manchester United o simplemente el United, es un club de fútbol de la ciudad de Mánchester, Inglaterra, Reino Unido, que disputa sus partidos como local en el estadio Old Trafford.'),(32,'Newcastle United',2,'El Newcastle United es un club de fútbol inglés que juega en la Premier League. Fundado en 1892 tras la fusión de dos equipos locales, el Newcastle East End y el Newcastle West End, al club se le conoce como The Magpies (Las Urracas) o The Toon.'),(33,'Norwich City',2,'El Norwich City Football Club es un club de fútbol de Inglaterra, de la ciudad de Norwich en Norfolk. Fue fundado en 1902 y juega en la Premier League. El mayor logro del equipo es haber conseguido la Carling Cup en dos ocasiones.'),(34,'Southampton',2,'El Southampton Football Club es un club de fútbol de Inglaterra de la ciudad de Southampton. Fue fundado el 21 de noviembre de 1885 y actualmente juega en la Premier League de Inglaterra.'),(35,'Stoke City',2,'El Stoke City Football Club es un Equipo de fútbol de Inglaterra, de la ciudad de Stoke-on-Trent en Staffordshire. Fue fundado en 1863 y juega en la Premier League.'),(36,'Sunderland',2,'El Sunderland Association Football Club es un club de fútbol de Inglaterra, de la ciudad de Sunderland en Tyne y Wear. Fue fundado en 1879 y juega en la Premier League de Inglaterra.'),(37,'Swansea City',2,'El Swansea City Association Football Club (en galés Clwb Pêl-droed Dinas Abertawe) es un club de fútbol de Gales de la ciudad de Swansea. Fue fundado en 1912 y juega en la Premier League de Inglaterra.'),(38,'Tottenham Hotspur',2,'Tottenham Hotspur Football Club, comúnmente conocido como los \"Spurs\", es un club de fútbol profesional situado en el barrio homónimo, ubicado en la zona norte de Londres. Compite en la FA Premier League, de la cual es uno de sus miembros creadores (véase FA Premier League 1992 - 93).'),(39,'West Bromwich Albion',2,'El West Bromwich Albion Football Club, también conocido como WBA, West Bromwich, es un club de fútbol de Inglaterra, de la ciudad de West Bromwich en West Midlands. Se fundó en 1878 por trabajadores de la fábrica George Salter\'s Spring Works y ha permanecido en la máxima categoría durante la mayor parte de su historia, además es uno de los clubes fundadores de la Football League de Inglaterra.'),(40,'West Ham United',2,'El West Ham United Football Club es un club de fútbol de Inglaterra, de la ciudad de Londres. Fue fundado en 1895 y juega en la Premier League, categoría a la cual regresó, luego de estar una temporada jugando en la Football League Championship.');

